import React from 'react';
import './Cart.css';

const Cart = (props) => {
    const{cart}=props;
    let total= 0;
    for(const card of cart){
        total=total+card.salary;
    }
    return (
        <div>
                <h3> Developer added:{props.cart.length}</h3>
                <h3> Total cost/hr: {total}</h3>
        </div>
    );
};

export default Cart;
